        //     return (
        //     <div className={style}>
        //         <img src={item}/>
        //     </div>
        //     );
        // });

        let arts = artworks.map((item, index) => {
            return (
            <div style={{border: '1px solid black'}}>
                <p>{index}</p>
            </div>
            );
        });


        return(
            <div>
                <div className="SmallGreenSpace"></div>
                <Menu/>
                <div className="Arts">
                    <h1>Arts</h1>
                    <div className="Wrapper">
                        {arts}
                    </div>
                </div>
            </div>
        );
    }
}
export default Arts;
